import React from 'react';
import RowTable from './RowTable';


function TableBody(props) {


    return (
        
        <>
            <tbody id="tablebody">
                {
                    props.dataTable.map((data, index) => <RowTable
                        dataRow={data}
                        key={index}
                        number={index + 1}
                        onclick={props.onclick}
                        CountRow={props.CountRow}
                    />
                    )
                }
            </tbody>
        </>  
    )
}

export default TableBody
